【手肌に優しく油汚れに強い手洗い洗剤 】　<br>
<br>
 ・指紋やシワの間についた油汚れをスッキリ落とす洗浄剤。「スクラブ粒子」配合。 <br>
・手についた頑固な油汚れや臭いを素早く落とし、その上中性でかつ手荒れ防止剤配合のため手が荒れにくく、さらっとした感じが手に残る。  <br>
・保湿効果のあるアロエエキスが肌の荒れに威力を発揮。水のいらない簡単で経済的なクリーム状の洗剤。  <br>
・水のないところやどこにでも手軽に持ち運びができる。 重金属類及びリン化合物、LAS、アルカリ剤等は全く含んでおらず、排水処理が簡単。  <br>
・スクラブを使っているので、配水管の詰まりがない。 <br>

 <br>
■使用場所 機械工場・自動車修理工場・印刷工場 <br>
■使用用途 業務用手洗い洗剤 <br>
■使用方法 1. 汚れた手に適量の（1.5g～2.0g）を取り、水をつけずによく擦りあわせる。 <br>
2. その後、水で洗い流すか、ウエスなどで拭き取る。汚れの落ちにくい指紋やシワ、爪の中等は特に良く擦る。 <br><style type="text/css">
